package com.FactoryModel.excemple.factory;import com.FactoryModel.excemple.Excemple;import com.FactoryModel.excemple.strategy.*;/** * Created by admin on 2017/4/20. */public class StrategyFactoryImpl implements StrategyFactory {    @Override    public StrategyInteface createStratege(Integer type) {        if (type == Excemple.KindEnum.STUDENT.getType()){            return new StudentStrategyImpl(type);        }else if (type == Excemple.KindEnum.TEACHHER.getType()){            return new TeacherStrategyImpl(type);        }else if (type == Excemple.KindEnum.EMPLOYEE.getType()){            return new EmployeeStrategyImpl(type);        }else {            return new DefaultStrategyImpl(type);        }    }}